draveness/analyze 详细说明了 +load 方法的调用时机： 0 +[XXObject load]
1 call_class_loads()
2 call_load_methods
3 load_images
4 dyld::notifySingle(dyld_image_states, ImageLoader const*)
11 _dyld_start 在有新的镜像加载后，都会调用 load_images 方法进行回调，这个方法是运行时在 _objc_init 方法中进行注册的： dyld_register_image_state_change_handler(dyld_image_state_dependents_initialized, 0/*not batch*/, &load_images); 类的 +load 方法会在父类的 +load 方法调用后再调用： static void schedule_class_load(Class cls)
{ if (!cls) return; // 类是否已经 realized assert(cls->isRealized()); // 判断类是否有调用过 +load if (cls->data()->flags & RW_LOADED) return; // 递归调用，先执行父类的 +load 方法 schedule_class_load(cls->superclass); // 添加当前类至列表 add_class_to_loadable_list(cls); // 设置为已调用过 +load cls->setInfo(RW_LOADED); } 分类的 +load 方法在类之后调用： void call_load_methods(void)
{ static bool loading = NO; bool more_categories; loadMethodLock.assertLocked(); // 加载中，直接返回 if (loading) return; loading = YES; void *pool = objc_autoreleasePoolPush(); do { // 调用类的 +load 方法，直到列表为空 while (loadable_classes_used > 0) { // ➡️ 调用类的 +load 方法 call_class_loads(); } // 调用分类的 +load 方法一次 more_categories = call_category_loads(); // 如果有类或者分类未调用 +load 方法，则尝试再调用一次 } while (loadable_classes_used > 0 || more_categories); objc_autoreleasePoolPop(pool); loading = NO;
} 调用分类 +load 方法时需要确保类已经加载： if (cls && cls->isLoadable()) { (*load_method)(cls, SEL_load); cats[i].cat = nil;
}

